import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Weapons from "./components/Weapons";

function App() {
  return (
    <div style={{ display: "grid", gridTemplateColumns: "repeat(4, 1fr)" }}>
      <Header />
      <Weapons />
      <Weapons />
      <Weapons />
      <Footer />
    </div>
  );
}

export default App;
